    <>

    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout/>}>
        <Route index element={<Home/>}/>
        <Route path="/display" element={<Display/>}/>




        </Route>
      </Routes>
    </BrowserRouter>

    </>
  );
}
export default App;
